this.tick = function(game) {
    if (game.step % 3 === 1) {
      for (let ship of game.ships) {
        shipshield(ship);
      }
    }
    
    if (game.step % 10 === 0) {
      for (let ship of game.ships) {
        shipgem(ship);
        
        if (!ship.custom.skill) {
          if (!ship.custom.skillShown) {
            ship.instructorSays("Skill issue!");
            ship.custom.skillTimer = game.step + 300;
            ship.custom.skillShown = true;
          }
          
          if (game.step > ship.custom.skillTimer) {
            ship.hideInstructor();
            ship.custom.skill = true;
          }
        }
      }
    }
};

const gemCapacity = [undefined, [20, 20, 20], [80, 80, 80], [180, 180, 180], [320, 320, 320], [500, 500, 500], [600, 1000, 720], [800, 2500, 980]];

let shields = {};

for (let ship in ships) {
  shields[JSON.parse(ships[ship]).level * 100 + JSON.parse(ships[ship]).model] = JSON.parse(ships[ship]).specs.shield.capacity;
}

const sendUI = function(ship, UI) {
  if (UI.visible || UI.visible === null) ship.setUIComponent(UI);
    else ship.setUIComponent({id: UI.id, position: [0,0,0,0], visible: false});
};

const countDigits = function (num) {
  if (num === 0) return 1;
  return Math.floor(Math.log10(Math.abs(num))) + 1;
};

const toEngineering = function (num) { // 10573 --> 10.57K
  if (num < 1e3) return num;
  let TriIndex = Math.trunc((countDigits(num) - 1) / 3);
  return (num / 10 ** (TriIndex * 3)).toFixed(2) + prefixes[TriIndex];
};

const prefixes = ["", "K", "M", "B", "t", "q", "Q", "s", "S", "o", "n", "d", "U", "D", "T", "Qt", "Qd"]; // Up to 10^48

function shipshield(ship, b) {
  let shield = shields[ship.type];
  let shipShield = Math.floor(shield[0] + (shield[1] - shield[0]) * (Math.floor(ship.stats / 10**7) / Math.floor(ship.type / 100)));
  if (!isNaN(ship.shield) && ship.shield >= 1000) sendUI(ship, {
    id: "shieldBar",
    position: [3.3,10.5,17.4,3],
    visible: true,
    components: [
      {type:"box",position:[0,0,100,100],fill:"hsla(170, 32%, 28%, 1)",stroke:"hsla(170, 32%, 28%, 1)",width:2},
      {type:"box",position:[0,0,100 * Math.min(ship.shield, shipShield) / shipShield,100],fill:"hsla(192, 97%, 74%, 1)",stroke:"hsla(192, 97%, 74%, 1)",width:2},
      {type: "text",position:[80,0,20,100],value: toEngineering(ship.shield),color:"hsla(0, 0%, 0%, 1)"}
    ]
  });
  else sendUI(ship, {id:"shieldBar",visible:false})
}

function shipgem(ship) {
  let level = Math.floor(Number(ship.type)/100);
  let gemStorage = gemCapacity[level];
  let customCap = gemStorage[1] - gemStorage[2];
  if (!ship.custom.gems) ship.custom.gems = 0;
  let totalGems = Math.min(ship.crystals + ship.custom.gems, gemStorage[1]);
  if (!isNaN(totalGems) && totalGems > gemStorage[0]) sendUI(ship, {
    id: "gemBar",
    position: [3.3,18.5,17.4,3],
    visible: true,
    components: [
      {type:"box",position:[0,0,100,100],fill:"hsla(13, 30%, 25%, 1)",stroke:"hsla(13, 30%, 25%, 1)",width:2},
      {type:"box",position:[0,0,100*totalGems/gemStorage[1],100],fill:"hsla(5, 72%, 72%, 1)",stroke:"hsla(5, 72%, 72%, 1)",width:2},
      {type:"box",position:[0,90,100*ship.crystals/gemStorage[2],10],fill:"hsla(5, 50%, 50%, 1)",stroke:"hsla(5, 50%, 50%, 1)",width:2},
      {type: "text",position:[80,0,20,100],value: toEngineering(totalGems),color:"hsla(0, 0%, 0%, 1)"}
    ]
  });
  else sendUI(ship, {id:"gemBar",visible:false})

  if (ship.crystals < gemStorage[0]) {
    let moveToMain = Math.min(ship.custom.gems, gemStorage[0] - ship.crystals);
    if (moveToMain > 0) {
      ship.custom.gems -= moveToMain;
      ship.set({crystals: ship.crystals + moveToMain});
    }
  } else if (ship.crystals > gemStorage[0] && ship.custom.gems < customCap) {
    let moveToCustom = Math.min(ship.crystals - gemStorage[0], customCap - ship.custom.gems);
    ship.custom.gems += moveToCustom;
    ship.set({crystals: ship.crystals - moveToCustom});
  }
  if (ship.custom.gems > customCap) ship.custom.gems = customCap;
}
